import React, { Component } from "react";

import { connect } from 'react-redux';

class CarList extends Component {
    render() {
        return (
            <div>
                <h2>List of Cars</h2>
                {console.log(this.props.cars)}
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        cars: state
    }
}

export default connect(mapStateToProps)(CarList);
